import styled from "styled-components";

export default styled.div`
  min-width: 300px;
  min-height: 300px;
  box-shadow: 0 14px 28px rgba(0, 0, 0, 0.25), 0 10px 10px rgba(0, 0, 0, 0.22);
  border-radius: 4px;
`;
